  });

  const customIterator = {
    [Symbol.iterator]() {
      let count = 0;
      return {
        next() {
          if (count < all.length) {
            count += 1;
            return { done: false, value: all[count - 1] };
          }
          return { done: true, value: undefined };
        },
      };
    },
  };
}
